class Node(object):

    def __init__(self, c, word_end=False):
        self._c = c
        self._word_end = word_end
        self._children = {}

    def has_child(self, c):
        return c in self._children

    def set_end_word(self):
        self._word_end = True

    def is_end_word(self):
        return self._word_end

    def get_child(self, c):
        return self._children.get(c)

    def get_c(self):
        return self._c

    def add_child(self, c):
        new_child = Node(c)
        if c not in self._children:
            self._children[c] = new_child
            return new_child
        else:
            return self.get_child(c)

    def empty(self):
        return len(self._children) == 0

    def is_concat(self, word, idx, root, memo):
        if idx >= len(word):
            return self.is_end_word()
        elif self.empty():
            if word[idx:] in memo:
                # print("HIT", word[idx:])
                return True
            return root.is_concat(word, idx, root, memo)
        elif self.has_child(word[idx]):
            child = self.get_child(word[idx])
            if self.is_end_word():
                if word[idx:] in memo:
                    # print("HIT", word[idx:])
                    return True
                return any([
                    child.is_concat(word, idx+1, root, memo),
                    root.is_concat(word, idx, root, memo),
                ])
            else:
                return child.is_concat(word, idx+1, root, memo)
        elif self.is_end_word():
            if word[idx:] in memo:
                # print("HIT", word[idx:])
                return True
            return root.is_concat(word, idx, root, memo)
        else:
            return False

class Trie(object):

    def __init__(self):
        """
        Initialize your data structure here.
        """
        self.__root = Node("*")
        self._has_empty = False

    def insert(self, word):
        """
        Inserts a word into the trie.
        :type word: str
        :rtype: void
        """
        if len(word) == 0:
            self._has_empty = True
            return
        current = self.__root
        for c in word:
            current = current.add_child(c)
        current.set_end_word()
                

    def search(self, word):
        """
        Returns if the word is in the trie.
        :type word: str
        :rtype: bool
        """
        if len(word) == 0:
            return self._has_empty
        current = self.__root
        for c in word:
            if current.has_child(c):
                current = current.get_child(c)
            else:
                return False
        return current.is_end_word()
        
    def startsWith(self, prefix):
        """
        Returns if there is any word in the trie that starts with the given prefix.
        :type prefix: str
        :rtype: bool
        """
        current = self.__root
        for c in prefix:
            if current.has_child(c):
                current = current.get_child(c)
            else:
                return False
        return True
    
    def is_concat(self, word, memo=set()):
        if self.__root.empty():
            return False
        return self.__root.is_concat(word, 0, self.__root, memo=memo)
            
class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        words.sort(key=len)
        concats = set()
        trie = Trie()
        for word in words:
            if trie.is_concat(word, memo=concats):
                # print("DONE", word)
                concats.add(word)
            trie.insert(word)
        return list(concats)

def test():
    solver = Solution()
    input1 = ["cat","cats","catsdogcats","dog","dogcatsdog","hippopotamuses","rat","ratcatdogcat", "s", "ratcatdogcats", "c", "a", "t"]
    output1 = ["catsdogcats","dogcatsdog","ratcatdogcat", "ratcatdogcats", "cat", "cats"]
    output1.sort()
    concats1 = solver.findAllConcatenatedWordsInADict(input1)
    concats1.sort()
    print(concats1)
    assert(concats1 == output1)

